import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import CreateBlog from "../CreateBlog";

const MainApp = () => {
  return (
    <div>
      <p>Header</p>
      <Router>
        <Switch>
          <Route path="/create-blog">
            <CreateBlog />
          </Route>
        </Switch>
      </Router>
      <p>Footer</p>
    </div>
  );
};

export default MainApp;
